import React, { Component} from 'react';
import './Layout.css';
import Navbar from './Navbar'

class Layout extends Component {
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div>
                test
                <Navbar />
                {this.props.children}
            </div>
        )
    }
}
export default Layout;
